import React, { useEffect } from "react";
// import { useState } from "react";
// import clsx from "clsx";

//Material UI Components
import { makeStyles } from "@material-ui/core/styles";

import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import ArrowBackIosIcon from "@material-ui/icons/ArrowBackIos";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
import CloudIcon from "@material-ui/icons/Cloud";
import Divider from "@material-ui/core/Divider";
// import Table from "@material-ui/core/Table";
// import TableBody from "@material-ui/core/TableBody";
// import TableCell from "@material-ui/core/TableCell";
// import TableContainer from "@material-ui/core/TableContainer";
// import TableHead from "@material-ui/core/TableHead";
// import TableRow from "@material-ui/core/TableRow";

//Custom useStyles
const useStyles = makeStyles((theme) => ({
  weatSumm: {
    border: "1px solid",
  },
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.secondary.light,
  },
  summMaxTemp: {
      fontWeight: "bold",
      fontSize: "15pt"
  }
}));

export default function WeatherSummary(props) {
  const classes = useStyles();

  useEffect(() => {}, []);

  return (
    <Grid
      container
      justifyContent="space-around"
      alignItems="center"
      style={{ marginTop: "0.5em", border: "1px solid" }}
    >
      {/* <h1>Weather Summary</h1> */}
      <Grid item contianer className={classes.weatSumm} alignItems="center">
        {/* <Paper variant="outlined"> */}
        <ArrowBackIosIcon />
        {/* </Paper> */}
      </Grid>
      <Grid item style={{ width: "20%" }}>
        <Paper variant="outlined">
          <Grid container direction="columnn" className={classes.root}>
            <Grid item container justifyContent="center" className={classes.summMaxTemp}>
              25
            </Grid>
            <Grid item container justifyContent="center">
              <Divider style={{ width: "80%", color: "black" }} />
            </Grid>
            <Grid item container justifyContent="center">
              16
            </Grid>
            <Grid item container justifyContent="center">
              <CloudIcon />
            </Grid>
            <Grid item container justifyContent="center" className={classes.weekDay}>
              Mon
            </Grid>
            <Grid item container justifyContent="center">
              21 | Jan
            </Grid>
          </Grid>
        </Paper>
      </Grid>
      <Grid item className={classes.weatSumm}>
        <Paper variant="outlined">3</Paper>
      </Grid>
      <Grid item className={classes.weatSumm}>
        <Paper variant="outlined">4</Paper>
      </Grid>
      <Grid item className={classes.weatSumm}>
        <Paper variant="outlined">5</Paper>
      </Grid>
      <Grid item className={classes.weatSumm}>
        <Paper variant="outlined">6</Paper>
      </Grid>
      <Grid item className={classes.weatSumm}>
        <Paper variant="outlined">
          <ArrowForwardIosIcon />
        </Paper>
      </Grid>
      {/* <Grid item>
        <TableContainer component={Paper}>
          <Table
            className={classes.table}
            size="small"
            aria-label="simple table"
          >
            <TableHead>
              <TableRow className={classes.tableHeader}>
                <TableCell>Appliance</TableCell>
                <TableCell align="right">kWh / Month</TableCell>
                <TableCell align="right">Monthly Cost</TableCell>
              </TableRow>
            </TableHead>
            <TableBody className={classes.tableBody}>
              {elecRows.map((row) => (
                <TableRow key={row.name}>
                  <TableCell component="th" scope="row">
                    {row.name}
                  </TableCell>
                  <TableCell align="right">{row.kwh}</TableCell>
                  <TableCell align="right">{row.cost}</TableCell>
                </TableRow>
              ))}
              <TableRow className={classes.tableFinalRow}>
                <TableCell>Total</TableCell>
                <TableCell align="right">132.99</TableCell>
                <TableCell align="right">R 356.41</TableCell>
              </TableRow>
            </TableBody>
          </Table>
        </TableContainer>
      </Grid> */}
    </Grid>
  );
}
